export class Book {
    constructor(private title: string, 
                private count: Number) { }

    public setTitle(title: string): void {
        this.title = title;
    }

    public setCount(count: Number): void {
        this.count = Number;
    }

    public getTitle(): string {
        return this.title;
    }

    public getCount(): string {
        return this.data1;
    }

    public getData2(): string {
        return this.data2;
    }
}
